from abc import abstractmethod, ABC

class PropertyMigration(ABC):

    @abstractmethod
    def migrationNumber(self) -> int:
        pass


class PropertyMigrationJS(PropertyMigration):

    @abstractmethod
    def up(self, old_properties: dict) -> dict:
        pass

    @abstractmethod
    def down(self, old_properties: dict) -> dict:
        pass


class PropertyMigrationObj(PropertyMigration):

    @abstractmethod
    def up(self, old_properties):
        pass

    @abstractmethod
    def down(self, new_properties):
        pass